package com.example.demofetchtypejpa.entity;import jakarta.persistence.*;import lombok.Data;import java.util.List;@Data@Entity(name = "productType")@Table(name = "product_type")public class ProductTypeEntity {    @Id    @GeneratedValue(strategy = GenerationType.IDENTITY)    private Integer id;    private String name;    @OneToMany(fetch = FetchType.EAGER)    @JoinColumn(name = "product_type_id")    private List<ProductEntity> products;}